const React = require('react');
const Layout = require("./components/Layout.jsx")


class Index extends React.Component {
    render() {
        return (
            <Layout>
                <h1>Budgeting</h1>
                <table> {
                    <tr>
                        <p>{budget.name}</p>
                     {
                        this.props.budget.map((budget, index)=>{
                            return (<td> {
                                <p>{budget.date}{budget.amount}{budget.from}</p>
                                }
                                 </td>
                             )
                        })
                    } </tr> 
                } </table>
            </Layout>       
        )}
};

module.exports = Index;

